import React from 'react'
import ForumPosts from './ForumPosts'

function Forum(props) {
    const {forumPosts} = props

    const renderForumPosts = forumPosts.map(posts => <ForumPosts key={posts.id} posts={posts}/>)
    return (
        <div>Forum
            {renderForumPosts}
        </div>

    )
}

export default Forum
